import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div>
      <h3>Expense Item</h3>
      <li>Food Rs 10</li>
      <li>Petrol Rs 100</li>
      <li>Movies Rs 200</li>
    </div>
  );
}

export default ExpenseItem;
